
public class Sample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		 int num=1;
	      while(num<11)
	      {
	    	  if(num%3==0)
	    	  {
	    		  num++;
	    		  continue;
	    		
	    	  }
	    	  System.out.println("Counting ="+num);
	    	  num++;
	      }

	}

}
